import React from 'react'

const Todoitems = ({bonda,onDelete}) => {
  return (
    <div>
      <h4>{bonda.title}</h4>
      <h5>{bonda.slno}</h5>
      <p>{bonda.desc}</p>
      <button className="btn btn-sm btn-danger" onClick={()=>{onDelete(bonda)}}>Delete</button>
    </div>
  )
}

export default Todoitems
